            Email<h1>{userData.email}</h1>
            UserType<h1>{userData.userType}</h1>
            ID<h1>{userData._id}</h1>
            <Link
              to={{
                pathname: "/updateProfile",
                state: { _id: userData._id },
              }}
              className="btn btn-primary"
