              className="btn btn-primary"
            >
              Dashboard
            </Link>
          </li>
          <span>Hi</span>
        </ul>
      </nav>
      <button onClick={addUser} className="btn btn-primary">
        Add User
      </button>
      <button onClick={logOut} className="btn btn-primary">
        Log Out
      </button>
    </div>
  );
}
